import React from 'react'
import Youtube from 'react-youtube';

const VideoPage = (props) => {

    const { id } = props.match.params;

    console.log(id);
    return (
        <div>
            <Youtube 
                id={id}
                videoId="yBULVheXj5c"
                className="w-100 mt-5"
            />

        </div>
    )
}

export default VideoPage
